import React from 'react';
import './FloatingCharacter.css';

const FloatingCharacter = () => {
  return (
    <div className="spider-container">
      <svg className="spider" viewBox="0 0 100 100">
        {/* Body */}
        <ellipse cx="50" cy="40" rx="12" ry="18" fill="#1a1a1a" />
        
        {/* Head */}
        <circle cx="50" cy="18" r="10" fill="#1a1a1a" />
        
        {/* Eyes */}
        <circle cx="45" cy="16" r="2" fill="#ff6b00" />
        <circle cx="55" cy="16" r="2" fill="#ff6b00" />
        
        {/* Front Left Legs */}
        <g className="leg leg-1">
          <path d="M 40 35 Q 25 25 15 20" stroke="#1a1a1a" strokeWidth="2" fill="none" strokeLinecap="round" />
        </g>
        <g className="leg leg-2">
          <path d="M 38 42 Q 18 35 8 32" stroke="#1a1a1a" strokeWidth="2" fill="none" strokeLinecap="round" />
        </g>
        
        {/* Front Right Legs */}
        <g className="leg leg-5">
          <path d="M 60 35 Q 75 25 85 20" stroke="#1a1a1a" strokeWidth="2" fill="none" strokeLinecap="round" />
        </g>
        <g className="leg leg-6">
          <path d="M 62 42 Q 82 35 92 32" stroke="#1a1a1a" strokeWidth="2" fill="none" strokeLinecap="round" />
        </g>
        
        {/* Back Left Legs */}
        <g className="leg leg-3">
          <path d="M 40 55 Q 20 65 10 75" stroke="#1a1a1a" strokeWidth="2" fill="none" strokeLinecap="round" />
        </g>
        <g className="leg leg-4">
          <path d="M 42 62 Q 22 75 15 88" stroke="#1a1a1a" strokeWidth="2" fill="none" strokeLinecap="round" />
        </g>
        
        {/* Back Right Legs */}
        <g className="leg leg-7">
          <path d="M 60 55 Q 80 65 90 75" stroke="#1a1a1a" strokeWidth="2" fill="none" strokeLinecap="round" />
        </g>
        <g className="leg leg-8">
          <path d="M 58 62 Q 78 75 85 88" stroke="#1a1a1a" strokeWidth="2" fill="none" strokeLinecap="round" />
        </g>
      </svg>
    </div>
  );
};

export default FloatingCharacter;
